import React from "react";
import { Row, Col } from "react-bootstrap";
import "./Style.css"

const Login = () =>{
    return(
        <>
        <div>
            <Row>
                <Col></Col>
                {/* Login Page */}
                <Col> 
                 <h1>Login Page</h1>
                </Col>
                <Col></Col>
            </Row>
        </div>
        </>
    )
};

export default Login
